import React, { Component } from "react";
import List from "./List.js";
import NewsletterList from "./NewsletterList";
import Tabs from "./Tabs";

class App extends Component {
  render() {
    return (
      <main>
        <Tabs />
        <div className="tab1">
          <h1>List of users </h1>
          <List />
        </div>
        <div className="tab2">
          <h1>List of subscribers</h1>
          <NewsletterList />
        </div>
      </main>
    );
  }
}

export default App;
